import React from "react";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import "../components/Signin/Signin.css";

export default function Navbar1() {
  return (
    <div>
      <Navbar
        expand="xxl"
        className="home-navbar"
        style={{ background: "rgba(0, 0, 0, 0)" }}
      >
        <Container fluid>
          <Navbar.Brand
            href="#"
            className="home-text-white"
            style={{ fontSize: "30px", fontWeight: "500", paddingLeft: "30px" }}
          >
            <i class="bi bi-chat-right-quote-fill"></i>
            &nbsp;&nbsp;Vibe Connect
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarScroll" />
          <Navbar.Collapse id="navbarScroll">
            <Nav
              className="me-auto my-2 my-lg-0 "
              style={{ maxHeight: "100px" }}
              navbarScroll
            >
              <Nav.Link href="#action1" className="home-text-white">
                Home
              </Nav.Link>
              <Nav.Link href="#action2" className="home-text-white">
                Link
              </Nav.Link>
            </Nav>
            <Form className="d-flex home-btn me-5">
              <Button
                variant="outline-danger"
                className="home-text-white me-5"
                style={{
                  fontWeight: "700",
                  border: "2px solid red",
                  width: "100px",
                }}
              >
                Log in
              </Button>
              &nbsp;&nbsp;
              <Button
                variant="outline-success"
                className="home-text-white"
                style={{
                  fontWeight: "700",
                  border: "2px solid green",
                  width: "100px",
                }}
              >
                Sign up
              </Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}
